import React from "react";

function App() {
    return (
      <>
        <Router>
          <NavBar />

          <div className="pages">
            <Routes>
              <Route path="/" element={<App />} />
              <Route path="/experience" element={<Experience />} />
              <Route path="/projects" element={<Projects />} />
            </Routes>
          </div>
        </Router>
    </>
    );
  }

  export default App;
